import React from 'react';
import { Paper, TextField } from '@mui/material';
import { styled } from '@mui/system';

const StyledPaper = styled(Paper)`
  padding: 20px;
  box-shadow: 0px 2px 4px rgba(0, 0, 0, 0.2);
`;

const C = () => {
  return (
    <StyledPaper>
      <TextField
        label="First Name"
        variant="outlined"
        fullWidth
        margin="normal"
      />
      <TextField
        label="Last Name"
        variant="outlined"
        fullWidth
        margin="normal"
      />
      <TextField
        label="Email"
        variant="outlined"
        fullWidth
        margin="normal"
      />
    </StyledPaper>
  );
};

export default C;
